self.addEventListener("install",(function(event){event.waitUntil(caches.open("sw-cache").then((function(cache){return cache.addAll(["index.html","styles.min.css","script.min.js","img/burger.png","img/coffee.png","img/juice.png","img/logo.png"])})))})),self.addEventListener("fetch",(function(event){event.respondWith(caches.match(event.request).then((function(response){return response||fetch(event.request)})))}));